import React from "react";
import "./FacPage.css"

class FacPage extends React.Component {
    constructor (props) {
        super(props);
        this.state = {
            members: ["1", "2", "3"].map((id) => {
                <div id="member"></div>
            })
        }
    }

    render() {
        return (
            <div id="members">
                {this.state.members}
            </div>
        )
    }
}

export default FacPage;
